  false,\n\t\"url\": null,\n\t\"notes\": \"Soil liquefaction potential was determined
  using existing geologic and alluvium maps. Quaternary, Tertiary, and Cretaceous-age
  sediments, and alluvium deposits are generally loose and unconsolidated and are
  labeled as liquefaction potential. The exception is alluvium in losing streams,
  which are indicative of a lower water table, reducing the potential for liquefaction
  in the area. However, not all losing streams in Missouri have been identified; therefore
  the potential exists for an unknown losing stream channel to be labeled as having
  liquefaction potential. This project was funded by Missouri State Emergency Management
  Agency.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
